      url: "/videos/vid1.mp4",
      no: 4,
    },
    {
      img: "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
      url: "/videos/vid1.mp4",
      no: 5,
    },
    {
      img: "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
      url: "/videos/vid1.mp4",
      no: 6,
    },
    {
      img: "https://ichef.bbci.co.uk/live-experience/cps/624/cpsprodpb/17D0E/production/_130105579_ashespreviewv2.jpg",
      url: "/videos/vid1.mp4",
      no: 7,
    },
    {
      img: "https://ichef.bbci.co.uk/live-experience/cps/624/cpsprodpb/17D0E/production/_130105579_ashespreviewv2.jpg",
      url: "/videos/vid1.mp4",
      no: 8,
    },
    {
      img: "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
      url: "/videos/vid1.mp4",
      no: 9,
    },
    {
      img: "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
      url: "/videos/vid1.mp4",
      no: 10,
    },
  ];

  const VideoPage = () => {
    const location = useLocation();
    const { movieurl } = location.state;
    return (
      <div>

<div class="banner">
		<div class="frame1">
			<p class="text p1">Conheça o programa que vai ajudar você a anunciar seus clientes no <span class="span">Google</span></p>
		</div>
		<div class="frame2">
			<div class="plataforma"></div>
			<p class="adword">
				<span class="adwords ar -deg">A</span>
				<span class="adwords ds deg">D</span>
				<span class="adwords wd">W</span>
				<span class="adwords o -deg">O</span>
				<span class="adwords ar -deg">R</span>
				<span class="adwords wd deg">D</span>
				<span class="adwords ds">S</span>
			</p>
			<div class="cifrao">
				<p class="cif">$</p>
				<p class="cif">$</p>
				<p class="cif">$</p>
				<p class="cif">$</p>
				<p class="cif">$</p>
			</div>
			<div class="processor"></div>
			<div class="sistema">
				<div class="boxleft"></div>
				<div class="gear-large">
					<div class="gear-large-in"></div>
				</div>
				<div class="gear-small">
					<div class="gear-small-in"></div>
				</div>
				<div class="pistao">
					<div class="pistaotop"></div>
					<div class="pistao-in"></div>
				</div>
			</div>
		</div>
		<div class="frame3">
			<p class="text p3">Aprenda mais sobre <span class="span">AdWords</span> e aproveite os beneficios:</p>
			<p class="text p3">Treinamento em AdWords . Certificação Google . Recompensas reais e virtuais</p>
		</div>
		<div class="frame4">
			<p class="google"><span class="Gg">G</span><span class="oe">o</span><span class="_o">o</span><span class="Gg">g</span><span class="_l">l</span><span class="oe">e</span> <span class="span engage">Engage</span></p>
			<p class="text p4">Transformando palavras em bons negócios</p>
			<button class="button">Clique aqui e participe</button>
		</div>


		<div class="colors blue"></div>
		<div class="colors red"></div>
		<div class="colors yellow"></div>
		<div class="colors green"></div>
	</div>

  
        <div className="video-container">
          <video controls className="responsive-video">
            <source src={movieurl} type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        </div>
      </div>
    );
  };

  const [currentPage, setCurrentPage] = useState(1);

  const handleNextPage = () => {
    setCurrentPage((prevPage) => prevPage + 1);
  };

  const handlePreviousPage = () => {
    setCurrentPage((prevPage) => prevPage - 1);
  };

  const startIndex = (currentPage - 1) * articlesPerPage;
  const endIndex = startIndex + articlesPerPage;
  const displayedArticles = articles.slice(startIndex, endIndex);

  const isPreviousDisabled = currentPage === 1;
  const isNextDisabled = endIndex >= articles.length;

  return (
    <div>
      <Router>
        <Switch>
          <Route exact path="/Page2">
            <Navbar />
            <br />
            <div className="container">
              <div className="container d-flex justify-content-between">
                <button className="btn btn-dark" onClick={handlePreviousPage} disabled={isPreviousDisabled}>Previous</button>
                <button className="btn btn-dark" onClick={handleNextPage} disabled={isNextDisabled}>Next</button>
              </div>
              <div className="row">
                {displayedArticles.map((element) => (
                  <div className="col-md-4" key={element.no}>
                    <Content imageurl={element.img} movieurl={element.url} />
                  </div>
                ))}
              </div>
            </div>
          </Route>
          <Route path="/video-page" component={VideoPage} />
        </Switch>
      </Router>
    </div>
  );
};

export default Page2;
